funcSearch:
function funcSearch() {
  log("funcSearch");
  const els = document.gcn("cancel inputBtn");
  log("els", els, els.length);
  const dictCourse = {
    레이크: "Lake",
    드래곤: "Dragon",
    스카이: "Sky",
  };
  const result = [];
  els.forEach((el, i) => {
    const param = el.parentNode.parentNode.children;
    const date = param[0].innerText.rm(".");
    const time = param[1].innerText.rm(":");
    const course = param[2].innerText;
    console.log("reserve search", dictCourse[course], date, time);
    result.push({ date, time, course: dictCourse[course] });
  });
  
  if(result.length == 0) {
    LOGOUT();
    return;
  }
  const param = {
    golf_club_id: "f919af75-eeb0-11ec-a93e-0242ac11000a",
    device_id: "${deviceId}",
    result,
  };
  const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
  post(addr, param, { "Content-Type": "application/json" }, (data) => {
    console.log(data);
    funcEnd();
  });
}
